import React, { Fragment } from "react";
import {
  Container,
  Card,
  Form,
  FormLabel,
  Row,
  Col,
  Button,
  FormCheck,
  FormGroup,
  FormSelect,
  FormControl,
} from "react-bootstrap";
const Studs = () => {
  return (
    <Container>
      <Row className="text-center">
        <h1>LISTADO DE STUDS</h1>
      </Row>

      <Row className="row justify-content-center">
        <Col className="bg-primary bg-opacity-50 border col-5" >
          <input className='col-9'></input>
          <button className="btn btn-primary ms-4">BUSCAR</button>
        </Col>
        
        <Col className="col-auto bg-success bg-opacity-50">
        <button className="btn btn-primary">AGREGAR STUD</button>
        </Col>
      </Row>

      <Row className="row-cols-3">
        
      </Row>
    </Container>
  );
};

export default Studs;
